import React from 'react'
import {useState} from 'react'
export const ClassList = () => {
  const [classList, setClassList] = useState([])
  return (
    <>
      {
        classList.map((val,key)=>{
          return(
            <>
            <div className="emp-details">
              <div>{val.sno}</div>
              <div>{val.name}</div>
              <div>{val.id}</div>
              <div>{val.age}</div>
              <div>{val.gender}</div>
              <button type="button" className="btn btn-sm btn-danger" onClick={()=>{deleteEmployee(val.sno)}}>delete</button>
            </div>
            </>
          )

        })
      }
    </>
  )
}
